import React from "react";

const About=()=>{
    
    return(
        <div>
            <h1>Creators of Society Management System</h1>
            <ul >
                <li className="creators">SHIVAM GARG</li>
                <li className="creators">YASH SINGH</li>
                <li className="creators">GAUTAM PRAKASH</li>
                <li className="creators">SONU CHAUDHARY</li>
            </ul>
        </div>
    )
}

export default About;
